import React, { useState } from 'react';
import './App.css';

function App() {
  const [activeTab, setActiveTab] = useState('home');

  const tabs = [
    { id: 'home', label: 'Home' },
    { id: 'about', label: 'About' },
    { id: 'services', label: 'Services' },
    { id: 'portfolio', label: 'Portfolio' },
    { id: 'contact', label: 'Contact' }
  ];

  const renderContent = () => {
    switch (activeTab) {
      case 'home':
        return (
          <div>
            <h2>Welcome to Our Website</h2>
            <p>This is the home page with an introduction to our company and services.</p>
          </div>
        );
      case 'about':
        return (
          <div>
            <h2>About Us</h2>
            <p>Learn more about our company, mission, and team.</p>
          </div>
        );
      case 'services':
        return (
          <div>
            <h2>Our Services</h2>
            <p>Discover the range of services we offer to our clients.</p>
          </div>
        );
      case 'portfolio':
        return (
          <div>
            <h2>Portfolio</h2>
            <p>View our previous work and successful projects.</p>
          </div>
        );
      case 'contact':
        return (
          <div>
            <h2>Contact Us</h2>
            <p>Get in touch with us for inquiries and support.</p>
          </div>
        );
      default:
        return <div>Page not found</div>;
    }
  };

  return (
    <div className="App">
      <header className="header">
        <h1>Simple React Website</h1>
        <nav className="nav">
          {tabs.map(tab => (
            <button
              key={tab.id}
              className={`nav-button ${activeTab === tab.id ? 'active' : ''}`}
              onClick={() => setActiveTab(tab.id)}
            >
              {tab.label}
            </button>
          ))}
        </nav>
      </header>
      <main className="content">
        {renderContent()}
      </main>
    </div>
  );
}

export default App;
